column36:
2018- Participei como bailarina da comissão de frente da Vilage no Samba, escola de samba de Nova Friburgo;
Desfilei nos 200 anos de Nova Friburgo mostrando a moda praia dos anos 2000;
Desfilei nos 200 anos de Nova Friburgo pelo Colégio Estadual Canadá como coreógrafa de baliza;
Participei do espetáculo de 200 anos de Nova Friburgo pelo Grupo Silvana Gym/INEC como passista.
2019- Participei como bailarina da comissão de frente da Vilage no Samba, escola de samba de Nova Friburgo;
Participei como bailarina da comissão de frente do Bloco carnavalesco Raio de Luar de Nova Friburgo; 
Participei do festival criativo do MERCI Escola de dança de Nova Friburgo representando a Terra.
Comecei a dar aulas no MERCI Escola de dança de Nova Friburgo de flexibilidade;
Participei do espetáculo do final de ano do MERCI Escola de dança de Nova Friburgo, tema Circo onde fui a baliza do espetáculo e coreografei a parte de flexibilidade.
2020- Participei como bailarina da comissão de frente da Vilage no Samba, escola de samba de Nova Friburgo;
Voltei a dar aulas de flexibilidade nas foi paralizado devido a pandemia;
Participei de um vídeo clip chamado Preta.

